import React, { FunctionComponent } from "react";
import { resourceEndPoint } from "../../API/apiEndpoint";
import './messageComponent.css'

interface MessageComponentProps {
    ProfilePic:string,
    Name:string,
    Message:string
}

const MessageComponent: FunctionComponent<MessageComponentProps> = ({ProfilePic,Name,Message}) => {
    return ( <div className="message-container">
        <div className="message-container__initails">
            <div className="message-container__img">
                <img src={resourceEndPoint + `/${ProfilePic}`}></img>
            </div>
            <div className="message-container__name"><p>{Name}</p></div>
        </div>
        <div>{Message}</div>
    </div> );
}

export default MessageComponent;
